import React from 'react';
import ReactTypingEffect from 'react-typing-effect';


function ReactTypingEffectDemo() {
    return (
      <ReactTypingEffect
        text="Hello." //text=["Hello.", "World!"]
      />
    );
  };

function Header() {
    
    return (
        <header /*style={headerStyle}*/ ReactTypingEffect={reactTypingEffectDemo}>
            <h1>ToDoList</h1>
        </header>
    )
}

const reactTypingEffectDemo = () => {
    return (
      <ReactTypingEffect
        text="Hello." //text=["Hello.", "World!"]
      />
    );
  };
const headerStyle = {
    background: '#333',
    color: '#fff',
    textAlign: 'center',
    padding: '10px'
}
export default Header;
